import React from 'react';
import Paper from '@mui/material/Paper';
import PersonIcon from '@mui/icons-material/Person';
import axios from 'axios';
import { Icon, TextField, Typography } from '@mui/material';

const LoginForm = () => {

    const getAPI = async ()=>{
        try{
            const result = await axios.get('http://localhost:5000/');
            console.log("Get API Result: ", result.data);            
        }catch(error){
            console.error(error);
        }
    }

    const loginPOST = async (values)=>{
        try{
            console.log("Started with POST API");
            const response = await axios.post("http://localhost:5000/", values);
            console.log(response.data);
        }catch(error){
            console.error("Error observer with loginPOST API", error);
        }
    }

    const onFinish = (values)=>{
        console.log('Success: ', values);
        loginPOST(values);
    }

    const onFinishFailed = (error)=>{
        console.log('Failed: ', error);
    }

   return(
    <Paper className='loginForm' elevation='20'>
        <Typography variant='h5' Icon='PersonIcon'>Login</Typography>
        <PersonIcon fontSize='medium' color='primary'  /><br></br>
        <TextField></TextField>
    </Paper>
   ) 
}

export default LoginForm;
